import './App.css';
import userList from './user/userList';
import userSingle from './user/userSingle';
import userForm from './user/userForm';

function App() {
  return (
    <div className="container-flud">
      <div className='row'>
        <div className='col s12'>Menu</div>
      </div>
      <div className='row'>
        <div className='col s3'><userList /></div>
        <div className='col s9'><userSingle /></div>
      </div>
      <div className='row'>
        <div className='col s12'><userForm /></div>
      </div>
    </div>
  );
}

export default App;
